import Navbar from '../components/Navbar';

const Index = () => {

  return (
    <main>
      <div id="header">
        <div id="header-logo">logo</div>
        <div id="header-tel" className="tel">tel</div>
        <div id="header-mail" className="mail">mail</div>
      </div>

      <Navbar />

      <div id="carroussel">carroussel</div>

      <div id="presentation">presentation</div>
      <div id="localization">localization</div>
      <div id="keys">keys</div>
      <div id="reviews">reviews</div>
      <div id="partners">partners</div>
      <div id="contact">contacts</div>
    </main>
  );

}

export default Index;
